import { configureStore } from '@reduxjs/toolkit'
import logger from 'redux-logger'
import { combineReducers} from "redux";
// import CasesReducer from '../reducers/cases';
import settings from '../reducers/settings';
import UserReducer from '../reducers/user';
import DocketReducer from '../reducers/docket';
import AuthReducer from '../reducers/auth';
import AppError from '../reducers/appErrors';
import NewCaseParams from '../reducers/newCaseParams'

const appReducer = combineReducers({
    settings: settings,
    docket: DocketReducer,
    auth: AuthReducer,
    appError: AppError,
    newCasePayload:NewCaseParams
})

const rootReducer = (state, action) => {

    const updatedState = Object.assign({}, state);

    if (action.type === 'AUTH_LOGOUT_SUCCESS') {
        Object.keys(updatedState).forEach(sk => {
            updatedState[sk] = undefined;
        })
    }

    return appReducer(updatedState, action)
}

export const setupStore = configureStore({
    reducer:rootReducer,
    middleware: (getDefaultMiddleware) => getDefaultMiddleware().concat(logger),
    devTools: process.env.NODE_ENV !== 'production'
})
